import { StyleSheet } from "react-native"

const styles = StyleSheet.create({
  container_back: {
    position: 'absolute',
    bottom: 0,
    width: "100%",
    height: "65%",
    backgroundColor: "#1E1E1E"
    },

  container: {
    position: 'absolute',
    bottom: 0,
    width: "100%",
    height: "65%",
    backgroundColor: "#1E1E1E"
  },



   })
export default styles
